import Square from "./Square";
import '../style/Board.css'


class Board extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name :'-'

        }
    }


    render(){
        return(
                <div>
                    
                    <div className="game">
                        <div>
                         <div className="img"></div>   
                         <h1>Jogo Da Velha</h1>
                        </div>
                        
                       
                        <div className="board">
                            
                            <ul>
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                            </ul>
                            <ul>
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                            </ul>
                            <ul>
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                                <Square name = {this.state.name} />
                            </ul>

                         </div>              
                     </div>
                </div>            
        )
    }
}

export default Board;
